import React from "react";

const App = () => {
  return (
    <>
      <h1>Redux Increment/Decrement Counter</h1>
      <div>
        <div className="quantity_minus">+</div>
        <div className="quantity_plus">-</div>
      </div>
    </>
  );
};

export default App;
